import React from 'react';

const FeedPhotosItem = ({ photo }) => {
  console.log(photo);
  return (
    <li>
      <img src={photo.src} alt={photo.title} />
      <span>{photo.acessos}</span>
    </li>
  );
};

export default FeedPhotosItem;
